import MainNav from "./MainNav";

function Layuout(props) {
  return (
    <div className="dark:bg-slate-950 font-urbanist bg-indigo-300 w-full h-screen  text-white">
      <MainNav />
      <main className="">
        {props.children}
      </main>
    </div>
  );
}

export default Layuout;
